import React from "react";

const Home = () => {
  const imgUrl =
    "https://images.unsplash.com/photo-1528287942171-fbe365d1d9ac?ixlib=rb-1.2.1&q=85&fm=jpg&crop=entropy&w=1200&cs=srgb&ixid=eyJhcHBfaWQiOjE0NTg5fQ";

  return (
    <div className="">
      <div class="dark">
        <h1>Chicago</h1>
        <img
          src="https://s3-us-west-2.amazonaws.com/s.cdpn.io/4273/chicago.jpg"
          alt="Photograph of the Chicago skyline taken from the water during the day"
        />
      </div>

      <div class="light">
        <h1>Houston</h1>
        <img
          src="https://s3-us-west-2.amazonaws.com/s.cdpn.io/4273/houston.jpg"
          alt="Photograph of the Houston skyline taken from a tree-lined park"
        />
      </div>
    </div>
  );
};

export default Home;
